import Header from '../components/Header';
import Navbar from '../components/navbar/navbar';
import Homepage from '../components/homepage/splashPage';
import About from '../components/schedule/schedule';
import Schedule from '../components/schedule/schedule';
import '../components/style.css';

const Home = () => (
    <div>
        <Header />
        <Navbar />
        <Homepage />
        <About />
        <Schedule />
    </div>
)

export default Home;
